import { Button, Affix } from "antd";
import { ShoppingCartOutlined } from "@ant-design/icons";

const AffixBottom = ({ cart }) => {
  return (
    <>
      <Affix style={{ position: "absolute", top: "90%", left: "80%" }}>
        <Button type="primary">
          <h1>
            <ShoppingCartOutlined />
            {cart.length}
          </h1>
        </Button>
      </Affix>
    </>
  );
};

export default AffixBottom;
